import React from 'react';
import { BrowserRouter, Routes,Route } from 'react-router-dom';
import Navbar from './components/navbar'
import News from './components/News';
import About from './components/about';

const App = () => {
  return <BrowserRouter>
      <Navbar/>
    <Routes>
      <Route exact key={entertainment} path='/entertainment' element={<News catagory="entertainment"/>} />
      <Route exact key={sports} path='/sports' element={<News catagory="sports"/>} />
      <Route exact key={health} path='/health' element={<News catagory="health"/>} />
      <Route exact key={business} path='/business' element={<News catagory="business"/>} />
      <Route exact key={technology} path='/technology' element={<News catagory="technology"/>} />
      <Route exact key={About} path='/about' element={<About/>} />
      <Route exact key={general} path='/home' element={<News catagory="general"/>} />
    </Routes>
  </BrowserRouter>

};

export default App;
